	<script>
	  /**
 * @param {number[][]} A
 * @return {number[][]}
 */
var transpose = function(A) {
	var B={};
	for(var i=0;i<A.length;i++){
		for(var j=0;j<A[i].length;j++){
			if(j in B){
				B[j].push(A[i][j]);
			}else{
				B[j]=[A[i][j]];
			};
		};
	};
	A=[];
	for(var key in B){
		A.push(B[key]);
	}
    console.log(A);
    return A;
};
res = new transpose([[1,2,3],[4,5,6]]);
